import Hero from "../components/Hero";
import Navbar from "../components/Navbar"
import AboutImg from "../assests/img9.avif"
import Footer from "../components/Footer";

function Service(){
    return(
        <>
            <Navbar />
            <Hero cName="hero-mid" 
            heroImg={AboutImg}
            //title="Con" 
            btnClass="hide" />
            <Footer />
        </>
    )
}

export default Service;
